Generally, communication between flight software and S2E is executed via OBC class. The OBC base class has communication ports and communication functions. Other components and flight software can use the communication functions to communicate. For C2A, the OBC_C2A has the following functions for C2A flight software. The driver functions in the flight software can use these functions. It is essential to use the same port_id with the component setting in S2E. The details are described in specification documents for each feature. Serial communication functions int OBC_C2A_SendFromObc(int port_id, unsigned char* buffer, int offset, int count);
int OBC_C2A_ReceivedByObc(int port_id, unsigned char* buffer, int offset, int count); I2C communication functions int OBC_C2A_I2cWriteCommand(int port_id, const unsigned char i2c_addr, const unsigned char* data, const unsigned char len);
int OBC_C2A_I2cWriteRegister(int port_id, const unsigned char i2c_addr, const unsigned char* data, const unsigned char len);
int OBC_C2A_I2cReadRegister(int port_id, const unsigned char i2c_addr, unsigned char* data, const unsigned char len); GPIO int OBC_C2A_GpioWrite(int port_id, const bool is_high);
bool OBC_C2A_GpioRead(int port_id); Currently, the C2A uses the wrapper functions in IfWrapper/Sils . The functions automatically overload the normal IfWrapper functions when C2A is executed on the S2E. Other interfaces like SPI, etc., will be implemented.

